	add("fantod", "{\"term\":\"fantod\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\"], \"text\":\"Probably from \u0027\u0027 (or \u0027\u0027 + possibly Welsh \u0027-od\u0027 (lang\u003dcy) See also \u0027fantigue\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of worry or nervous anxiety, irritability\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"For examples of usage of this sense, see\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An irritable outburst\", \"priority\":3}]}, \"synonyms\":{}}");

